import { React } from "react";
import "./navbar.css";

const Navbar = () => {
  return (
    <>
      <div>
        <ul className="nav-avatar-ul">
          <div className="nav-avatar-div">
            <img

              src="/images/man-avatar.jpg"
              alt="avatar"
            />
          </div>
          <li>Angela Gray</li>
          <li>
            <small>angela@gmail.com</small>
          </li>
        </ul>
      </div>
    </>
  );
};

export default Navbar;
